import React from 'react'
import { Navbar, Footer } from '../components'
import pageClass from '../styles/pages.module.sass'


const DefaultLayout: React.FC = ({ children }): React.ReactElement => {
	return (
		<>
			<Navbar />
			<div className={`${pageClass.default} container`}>
				{children}
			</div>
			<Footer />
		</>
	)
}


export default DefaultLayout
